INSERT INTO `cv_tentang_saya` (`id`, `user_id`, `deskripsi`, `createdAt`, `updatedAt`) VALUES
(1, 27, 'Saya adalah Fresh graduate Sistem Informasi dengan passion di pengembangan web dan backend engineering. Memiliki dasar kuat dalam algoritma, database, dan arsitektur sistem. Terampil dalam PHP, JavaScript, dan framework modern untuk membangun solusi digital yang scalable, efisien, dan user-friendly. Siap berkontribusi dalam tim dengan semangat belajar tinggi dan pendekatan solutif.', '2025-12-15 20:41:17', '2025-12-19 14:08:08');
