INSERT INTO `job_posts` (`job_id`, `employer_id`, `title`, `description`, `requirements`, `job_category_id`, `salary_min`, `salary_max`, `location`, `employment_type`, `status`, `posted_at`, `deadline`) VALUES
(10, 28, 'Frontend Developer', 'Kami sedang mencari Frontend Developer yang kreatif dan penuh semangat untuk bergabung dalam tim pengembangan produk digital kami. Anda akan bertanggung jawab dalam menciptakan tampilan website yang menarik, responsif, dan user-friendly â€” menghidupkan desain menjadi pengalaman digital yang optimal bagi pengguna.\n\nTanggung Jawab Utama:\n1. Mengembangkan dan memelihara antarmuka website yang modern dan efisien.\n2. Berkolaborasi dengan tim desain dan backend untuk menciptakan pengalaman pengguna yang seamless.\n3. Optimasi performa dan kompatibilitas lintas perangkat dan browser.', 'Menguasai HTML, CSS, dan JavaScript dengan baik.\nMemiliki pemahaman tentang prinsip desain responsif dan UI/UX.\nDapat bekerja secara mandiri maupun dalam tim.\nBersemangat belajar dan mengikuti perkembangan teknologi frontend terbaru.', 3, 5000000.00, 8000000.00, 'KOTA SURAKARTA', 'Full-time', 'Open', '2025-12-10 09:06:16', '2025-12-24 23:59:59'),
(11, 28, 'Full Stack Developer', 'Bertanggung jawab mengembangkan aplikasi web secara end-to-end, mulai dari antarmuka pengguna (frontend) hingga logika server dan database (backend).', 'Menguasai HTML, CSS, JavaScript, serta salah satu framework backend (Node.js/Python/Java) dan database (MySQL/PostgreSQL/MongoDB)', 3, 2000000.00, 4000000.00, 'KABUPATEN SUKOHARJO', 'Contract', 'Open', '2025-12-04 08:49:37', '2025-12-08 15:59:59'),
(12, 28, 'tes naruto sasuke', 'tes', 'tes', 3, 1000000.00, 2000000.00, 'KABUPATEN LINGGA', 'Part-time', 'Open', '2025-12-19 13:58:39', '2026-01-10 23:59:59'),
(13, 32, 'tes', 'tes', 'tes', 3, 1999999.00, 5000000.00, 'KOTA JAKARTA TIMUR', 'Freelance', 'Open', '2025-12-14 07:41:54', '2025-12-25 23:59:59');
